One flower on one inflorescence;
	dorsal sepal light yellow-green, spotted maroon centrally, white edge;
	synsepal light yellow-green;
	petals light yellow-green overlaid mauve, fine mauve spotting apically;
	pouch light yellow-green overlaid mauve; staminode light yellow-green overlaid mauve, green spot centrally;


	substance average; texture glossy.
